import React from "react";

function Navbar() {
  return (
    <div className="nav">
      <img
        className="nav__logo"
        src="https://en.wikipedia.org/wiki/Netflix#/media/File:Netflix_2015_logo.svg"
        alt=""
      />
    </div>
  );
}

export default Navbar;
